exports.push([module.i, "\n.action-link[data-v-5d1d7d82] {\n    cursor: pointer;\n}\n.m-b-none[data-v-5d1d7d82] {\n    margin-bottom: 0;\n}\n", "", {"version":3,"sources":["/home/cry/deepspring/resources/assets/js/components/passport/resources/assets/js/components/passport/Clients.vue?0a388e40"],"names":[],"mappings":";AACA;IACA,gBAAA;CACA;AAEA;IACA,iBAAA;CACA","file":"Clients.vue","sourcesContent":["<style scoped>\n    .action-link {\n        cursor: pointer;\n    }\n\n    .m-b-none {\n        margin-bottom: 0;\n    }\n</style>\n\n<template>\n    <div>\n        <div class=\"panel panel-default\">\n            <div class=\"panel-heading\">\n                <div style=\"display: flex; justify-content: space-between; align-items: center;\">\n                    <span>\n                        OAuth Clients\n                    </span>\n\n                    <a class=\"action-link\" @click=\"showCreateClientForm\">\n                        Create New Client\n                    </a>\n                </div>\n            </div>\n\n            <div class=\"panel-body\">\n                <!-- Current Clients -->\n                <p class=\"m-b-none\" v-if=\"clients.length === 0\">\n                    You have not created any OAuth clients.\n                </p>\n\n                <table class=\"table table-borderless m-b-none\" v-if=\"clients.length > 0\">\n                    <thead>\n                        <tr>\n                            <th>Client ID</th>\n                            <th>Name</th>\n                            <th>Secret</th>\n                            <th></th>\n                            <th></th>\n                        </tr>\n                    </thead>\n\n                    <tbody>\n                        <tr v-for=\"client in clients\">\n                            <!-- ID -->\n                            <td style=\"vertical-align: middle;\">\n                                {{ client.id }}\n                            </td>\n\n                            <!-- Name -->\n                            <td style=\"vertical-align: middle;\">\n                                {{ client.name }}\n                            </td>\n\n                            <!-- Secret -->\n                            <td style=\"vertical-align: middle;\">\n                                <code>{{ client.secret }}</code>\n                            </td>\n\n                            <!-- Edit Button -->\n                            <td style=\"vertical-align: middle;\">\n                                <a class=\"action-link\" @click=\"edit(client)\">\n                                    Edit\n                                </a>\n                            </td>\n\n                            <!-- Delete Button -->\n                            <td style=\"vertical-align: middle;\">\n                                <a class=\"action-link text-danger\" @click=\"destroy(client)\">\n                                    Delete\n                                </a>\n                            </td>\n                        </tr>\n                    </tbody>\n                </table>\n            </div>\n        </div>\n\n        <!-- Create Client Modal -->\n        <div class=\"modal fade\" id=\"modal-create-client\" tabindex=\"-1\" role=\"dialog\">\n            <div class=\"modal-dialog\">\n                <div class=\"modal-content\">\n                    <div class=\"modal-header\">\n                        <button type=\"button \" class=\"close\" data-dismiss=\"modal\" aria-hidden=\"true\">&times;</button>\n\n                        <h4 class=\"modal-title\">\n                            Create Client\n                        </h4>\n                    </div>\n\n                    <div class=\"modal-body\">\n                        <!-- Form Errors -->\n                        <div class=\"alert alert-danger\" v-if=\"createForm.errors.length > 0\">\n                            <p><strong>Whoops!</strong> Something went wrong!</p>\n                            <br>\n                            <ul>\n                                <li v-for=\"error in createForm.errors\">\n                                    {{ error }}\n                                </li>\n                            </ul>\n                        </div>\n\n                        <!-- Create Client Form -->\n                        <form class=\"form-horizontal\" role=\"form\">\n                            <!-- Name -->\n                            <div class=\"form-group\">\n                                <label class=\"col-md-3 control-label\">Name</label>\n\n                                <div class=\"col-md-7\">\n                                    <input id=\"create-client-name\" type=\"text\" class=\"form-control\"\n                                                                @keyup.enter=\"store\" v-model=\"createForm.name\">\n\n                                    <span class=\"help-block\">\n                                        Something your users will recognize and trust.\n                                    </span>\n                                </div>\n                            </div>\n\n                            <!-- Redirect URL -->\n                            <div class=\"form-group\">\n                                <label class=\"col-md-3 control-label\">Redirect URL</label>\n\n                                <div class=\"col-md-7\">\n                                    <input type=\"text\" class=\"form-control\" name=\"redirect\"\n                                                    @keyup.enter=\"store\" v-model=\"createForm.redirect\">\n\n                                    <span class=\"help-block\">\n                                        Your application's authorization callback URL.\n                                    </span>\n                                </div>\n                            </div>\n                        </form>\n                    </div>\n\n                    <!-- Modal Actions -->\n                    <div class=\"modal-footer\">\n                        <button type=\"button\" class=\"btn btn-default\" data-dismiss=\"modal\">Close</button>\n\n                        <button type=\"button\" class=\"btn btn-primary\" @click=\"store\">\n                            Create\n                        </button>\n                    </div>\n                </div>\n            </div>\n        </div>\n\n        <!-- Edit Client Modal -->\n        <div class=\"modal fade\" id=\"modal-edit-client\" tabindex=\"-1\" role=\"dialog\">\n            <div class=\"modal-dialog\">\n                <div class=\"modal-content\">\n                    <div class=\"modal-header\">\n                        <button type=\"button \" class=\"close\" data-dismiss=\"modal\" aria-hidden=\"true\">&times;</button>\n\n                        <h4 class=\"modal-title\">\n                            Edit Client\n                        </h4>\n                    </div>\n\n                    <div class=\"modal-body\">\n                        <!-- Form Errors -->\n                        <div class=\"alert alert-danger\" v-if=\"editForm.errors.length > 0\">\n                            <p><strong>Whoops!</strong> Something went wrong!</p>\n                            <br>\n                            <ul>\n                                <li v-for=\"error in editForm.errors\">\n                                    {{ error }}\n                                </li>\n                            </ul>\n                        </div>\n\n                        <!-- Edit Client Form -->\n                        <form class=\"form-horizontal\" role=\"form\">\n                            <!-- Name -->\n                            <div class=\"form-group\">\n                                <label class=\"col-md-3 control-label\">Name</label>\n\n                                <div class=\"col-md-7\">\n                                    <input id=\"edit-client-name\" type=\"text\" class=\"form-control\"\n                                                                @keyup.enter=\"update\" v-model=\"editForm.name\">\n\n                                    <span class=\"help-block\">\n                                        Something your users will recognize and trust.\n                                    </span>\n                                </div>\n                            </div>\n\n                            <!-- Redirect URL -->\n                            <div class=\"form-group\">\n                                <label class=\"col-md-3 control-label\">Redirect URL</label>\n\n                                <div class=\"col-md-7\">\n                                    <input type=\"text\" class=\"form-control\" name=\"redirect\"\n                                                    @keyup.enter=\"update\" v-model=\"editForm.redirect\">\n\n                                    <span class=\"help-block\">\n                                        Your application's authorization callback URL.\n                                    </span>\n                                </div>\n                            </div>\n                        </form>\n                    </div>\n\n                    <!-- Modal Actions -->\n                    <div class=\"modal-footer\">\n                        <button type=\"button\" class=\"btn btn-default\" data-dismiss=\"modal\">Close</button>\n\n                        <button type=\"button\" class=\"btn btn-primary\" @click=\"update\">\n                            Save Changes\n                        </button>\n                    </div>\n                </div>\n            </div>\n        </div>\n    </div>\n</template>\n\n<script>\n    export default {\n        /*\n         * The component's data.\n         */\n        data() {\n            return {\n                clients: [],\n\n                createForm: {\n                    errors: [],\n                    name: '',\n                    redirect: ''\n                },\n\n                editForm: {\n                    errors: [],\n                    name: '',\n                    redirect: ''\n                }\n            };\n        },\n\n        /**\n         * Prepare the component (Vue 1.x).\n         */\n        ready() {\n            this.prepareComponent();\n        },\n\n        /**\n         * Prepare the component (Vue 2.x).\n         */\n        mounted() {\n            this.prepareComponent();\n        },\n\n        methods: {\n            /**\n             * Prepare the component.\n             */\n            prepareComponent() {\n                this.getClients();\n\n                $('#modal-create-client').on('shown.bs.modal', () => {\n                    $('#create-client-name').focus();\n                });\n\n                $('#modal-edit-client').on('shown.bs.modal', () => {\n                    $('#edit-client-name').focus();\n                });\n            },\n\n            /**\n             * Get all of the OAuth clients for the user.\n             */\n            getClients() {\n                axios.get('/oauth/clients')\n                        .then(response => {\n                            this.clients = response.data;\n                        });\n            },\n\n            /**\n             * Show the form for creating new clients.\n             */\n            showCreateClientForm() {\n                $('#modal-create-client').modal('show');\n            },\n\n            /**\n             * Create a new OAuth client for the user.\n             */\n            store() {\n                this.persistClient(\n                    'post', '/oauth/clients',\n                    this.createForm, '#modal-create-client'\n                );\n            },\n\n            /**\n             * Edit the given client.\n             */\n            edit(client) {\n                this.editForm.id = client.id;\n                this.editForm.name = client.name;\n                this.editForm.redirect = client.redirect;\n\n                $('#modal-edit-client').modal('show');\n            },\n\n            /**\n             * Update the client being edited.\n             */\n            update() {\n                this.persistClient(\n                    'put', '/oauth/clients/' + this.editForm.id,\n                    this.editForm, '#modal-edit-client'\n                );\n            },\n\n            /**\n             * Persist the client to storage using the given form.\n             */\n            persistClient(method, uri, form, modal) {\n                form.errors = [];\n\n                axios[method](uri, form)\n                    .then(response => {\n                        this.getClients();\n\n                        form.name = '';\n                        form.redirect = '';\n                        form.errors = [];\n\n                        $(modal).modal('hide');\n                    })\n                    .catch(response => {\n                        if (typeof response.data === 'object') {\n                            form.errors = _.flatten(_.toArray(response.data));\n                        } else {\n                            form.errors = ['Something went wrong. Please try again.'];\n                        }\n                    });\n            },\n\n            /**\n             * Destroy the given client.\n             */\n            destroy(client) {\n                axios.delete('/oauth/clients/' + client.id)\n                        .then(response => {\n                            this.getClients();\n                        });\n            }\n        }\n    }\n</script>\n"],"sourceRoot":""}]);

